// Convertir fecha de input a local sin cambiar la hora
function convertirFechaLocalISO(fechaStr) {
  let fecha = new Date(fechaStr); // La fecha ingresada
  return fecha.toISOString().split("T")[0]; // Solo la parte de la fecha YYYY-MM-DD
}

//Funcion para filtrar por fecha
async function filtrarPorFecha() {
  const fechaInicioInput = document.getElementById("fechaInicio").value;
  const fechaFinInput = document.getElementById("fechaFin").value;
  const filtroActivo = document.getElementById("filtroActivo");

  if (!fechaInicioInput || !fechaFinInput) {
    showAlert("No se encontraron los campos de fecha.", "error");
    return;
  }

  // Convertir las fechas de "YYYY-MM-DD" a timestamps en milisegundos
  const fechaInicio = new Date(`${fechaInicioInput}T00:00:00`).getTime();
  const fechaFin = new Date(`${fechaFinInput}T23:59:59.999`).getTime();

  if (isNaN(fechaInicio) || isNaN(fechaFin)) {
    console.error("Error: Fechas no v√°lidas");
    return alert("Error: Fechas no v√°lidas");
  }

  try {
    let response = await fetch("https://oficios-imssb.onrender.com/filtrar-oficios", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        fechaInicio: fechaInicio,
        fechaFin: fechaFin,
      }),
    });

    let data = await response.json();

    // Verifica que data sea un arreglo
    if (!Array.isArray(data)) {
      console.error("La respuesta del servidor no es un arreglo.");
      return;
    }

    // Ordenar los resultados por fecha (en orden descendente, puedes cambiarlo a ascendente si lo prefieres)
    data.sort((a, b) => {
      let fechaA = a.fecha;
      let fechaB = b.fecha;

      // Verificamos si la fecha es en formato timestamp (con _seconds y _nanoseconds)
      if (fechaA?._seconds && fechaA?._nanoseconds) {
        fechaA = fechaA._seconds * 1000 + fechaA._nanoseconds / 1000000;
      } else if (typeof fechaA !== "number") {
        fechaA = new Date(fechaA).getTime();
      }

      if (fechaB?._seconds && fechaB?._nanoseconds) {
        fechaB = fechaB._seconds * 1000 + fechaB._nanoseconds / 1000000;
      } else if (typeof fechaB !== "number") {
        fechaB = new Date(fechaB).getTime();
      }

      return fechaB - fechaA; // Orden descendente (para ascendente cambia a fechaA - fechaB)
    });

    let tabla = document.getElementById("tablaOficios");
    let tbody = document.getElementById("tablaCuerpo");

    tbody.innerHTML = ""; // Limpiar tabla

    if (data.length === 0) {
      tbody.innerHTML =
        "<tr><td colspan='7'>No se encontraron registros en ese rango de fechas.</td></tr>";
    } else {
      let rows = data.map((oficio) => {
        let fecha = oficio.fecha;
        // Verificamos si la fecha es en formato timestamp (con _seconds y _nanoseconds)
        if (fecha?._seconds && fecha?._nanoseconds) {
          fecha = fecha._seconds * 1000 + fecha._nanoseconds / 1000000;
        } else if (typeof fecha !== "number") {
          fecha = new Date(fecha).getTime();
        }

        return `
          <tr>
            <td>${oficio.folio}</td>
            <td>${oficio.asunto}</td>
            <td>${oficio.destinatario}</td>
            <td>${oficio.remitente}</td>
            <td>${oficio.estado}</td>
            <td>${new Date(fecha).toLocaleString()}</td>
          <td><a href="${
            oficio.enlace
          }" target="_blank"><i class="fa-solid fa-eye"></i></a></td>
         <td>
              <button onclick='abrirModalEditar("${oficio.id}", "${
          oficio.folio || ""
        }", "${oficio.asunto || ""}", "${oficio.destinatario || ""}", "${
          oficio.remitente || ""
        }", "${oficio.estado || ""}")'><i class="fa-solid fa-pencil"></i>
          </button>
            </td>
          </tr>
        `;
      });

      tbody.innerHTML = rows.join("");
      // Mostrar el tachecito rojo
      filtroActivo.style.display = "inline-block";
    }
  } catch (error) {
    console.error("Error al obtener datos:", error);
  }
}

