//Script para EXPORTAR PDF
document.getElementById("generarPDF").addEventListener("click", function () {
  // Obtener referencia a la tabla
  const tabla = document.getElementById("tablaOficios");

  if (!tabla) {
    console.error("No se encontr√≥ la tabla.");
    return;
  }

  // Obtener las filas visibles de la tabla
  const filas = tabla.querySelectorAll("tbody tr");

  if (filas.length === 0) {
    alert("No hay registros para generar el PDF.");
    return;
  }

  // Crear un array para almacenar los datos de la tabla
  let datos = [];
  filas.forEach((fila, index) => {
    let columnas = fila.querySelectorAll("td");
    let filaData = [index + 1];

    columnas.forEach((columna) => {
      filaData.push(columna.innerText);
    });

    datos.push(filaData);
  });

  // Crear el PDF con jsPDF
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF({
    orientation: "landscape",
    unit: "mm",
    format: "a4",
  });

  // Obtener la fecha actual en formato legible
  const fechaActual = new Date().toLocaleDateString("es-ES", {
    year: "numeric",
    month: "long",
    day: "numeric",
    hour: "2-digit",
    minute: "2-digit",
  });

  // üñºÔ∏è Agregar imagen superior (Debe ser en base64 o una URL v√°lida)
  const img = new Image();

  img.src =
    "data:image/png;base64,"; 

  // T√≠tulo del PDF
  doc.setFontSize(20);
  doc.text("Reporte de Oficios", 120, 15);
  doc.setFontSize(12);
  doc.text(`Fecha: ${fechaActual} hrs.`, 210, 30);

  // Generar la tabla con autoTable
  doc.autoTable({
    head: [
      ["#", "Folio", "Asunto", "Destinatario", "Remitente", "Estado", "Fecha"],
    ], // Encabezados
    body: datos, // Datos obtenidos
    startY: 40, // Posici√≥n inicial
    theme: "striped",
    styles: {
      fontSize: 10,
      cellPadding: 3,
      overflow: "linebreak",
      halign: "center",
    },
    columnStyles: {
      0: { cellWidth: "auto" }, // #
      1: { cellWidth: "auto" }, // Folio
      2: { cellWidth: "auto" }, // Asunto
      3: { cellWidth: "auto" }, // Destinatario
      4: { cellWidth: "auto" }, // Remitente
      5: { cellWidth: "auto" }, // Estado
      6: { cellWidth: 50 }, // Fecha
    },
  });

  // Descargar el PDF
  doc.save("Reporte_Oficios.pdf");
  showAlert("PDF se exporto exitosamente", "success");
});

//SCRIPT PARA EXPORTAR EXCEL
document
  .getElementById("exportarExcel")
  .addEventListener("click", async function () {
    const tabla = document.getElementById("tablaOficios");
    if (!tabla) {
      console.error("No se encontr√≥ la tabla.");
      return;
    }

    const filas = tabla.querySelectorAll("tbody tr");
    if (filas.length === 0) {
      alert("No hay registros para exportar.");
      return;
    }

    // Crear un nuevo libro y hoja
    let workbook = new ExcelJS.Workbook();
    let worksheet = workbook.addWorksheet("Reporte Oficios");

    // Definir encabezados con estilos
    let encabezados = [
      "#",
      "Folio",
      "Asunto",
      "Destinatario",
      "Remitente",
      "Estado",
      "Fecha",
    ];
    let rowEncabezado = worksheet.addRow(encabezados);

    rowEncabezado.eachCell((cell) => {
      cell.font = { bold: true, size: 13, color: { argb: "FFFFFF" } }; // Texto blanco y negrita
      cell.fill = {
        type: "pattern",
        pattern: "solid",
        fgColor: { argb: "0070C0" }, // Fondo azul
      };
      cell.alignment = { horizontal: "center", vertical: "middle" };
    });

    // Agregar datos a la tabla
    filas.forEach((fila, index) => {
      let columnas = fila.querySelectorAll("td");
      let filaData = [index + 1]; // N√∫mero incremental

      columnas.forEach((columna) => {
        filaData.push(columna.innerText);
      });

      let row = worksheet.addRow(filaData);

      // Centrar toda la fila
      row.eachCell((cell) => {
        cell.alignment = { horizontal: "center", vertical: "middle" };
      });
    });

    // Ajustar ancho de columnas
    worksheet.columns = [
      { width: 5 },
      { width: 20 },
      { width: 30 },
      { width: 25 },
      { width: 25 },
      { width: 15 },
      { width: 20 },
    ];

    // Guardar archivo
    let buffer = await workbook.xlsx.writeBuffer();
    let blob = new Blob([buffer], {
      type: "application/vnd.openxmlformats-officedocument.spreadsheetml.sheet",
    });
    let link = document.createElement("a");
    link.href = URL.createObjectURL(blob);
    link.download = "Reporte_Oficios.xlsx";
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link);

    showAlert("Excel se exporto exitosamente", "success");
  });

//Alerta Modificaciones

function showAlert(message, type = "success") {
  const alertBox = document.getElementById("customAlert");
  const alertMessage = document.getElementById("alertMessage");
  const alertIcon = document.getElementById("alertIcon");

  // Configurar mensaje e icono
  alertMessage.textContent = message;

  // Limpiar clases anteriores
  alertBox.classList.remove("success", "error", "warning");

  // Asignar clase e icono seg√∫n el tipo de mensaje
  switch (type) {
    case "success":
      alertBox.classList.add("success");
      alertIcon.textContent = "‚úÖ"; // Icono de √©xito
      break;
    case "error":
      alertBox.classList.add("error");
      alertIcon.textContent = "‚ùå"; // Icono de error
      break;
    case "warning":
      alertBox.classList.add("warning");
      alertIcon.textContent = "‚ö†Ô∏è"; // Icono de advertencia
      break;
    default:
      alertBox.classList.add("success");
      alertIcon.textContent = "‚ÑπÔ∏è"; // Icono de informaci√≥n por defecto
  }

  alertBox.style.display = "block";
}

function closeAlert() {
  document.getElementById("customAlert").style.display = "none";
}
